import { makeStyles } from "@mui/styles";

export default makeStyles({
  modal: {
    background: 'rgb(39, 41, 50)',
    width: '400px',
    height: '150px',
    margin: '0 auto',
    marginTop: '50vh',
    transform: 'translateY(-50vh)'
  }
});
